       -moz-user-select: none;
        -ms-user-select: none;

  <script src="https://code.jquery.com/jquery-1.12.4.js"></script>
  <script
     id="script6342">
function startMove(evt, moveType){
     x1 = evt.clientX;
     y1 = evt.clientY;
     document.documentElement.setAttribute("onmousemove","moveIt(evt)")
     document.documentElement.setAttribute("ontouchmove","moveIt(evt)")

     C = document.getElementById('mouse');
     //C.setAttributeNS(null, "onmouseout", "endMove()");
     C.setAttributeNS(null, "onmouseup", "endMove()");
     C.setAttributeNS(null, "ontouchend", "endMove()");
}

function moveIt(evt){
    translation = C.getAttributeNS(null, "transform").slice(10,-1).split(',');
    sx = parseInt(translation[0]);
    sy = parseInt(translation[1]);

    C.setAttributeNS(null, "transform", "translate(" + (sx + evt.clientX - x1) + "," + (sy + evt.clientY - y1) + ")");
    x1 = evt.clientX;
    y1 = evt.clientY;
}

function endMove(){
    document.documentElement.setAttributeNS(null, "onmousemove",null)
    document.documentElement.setAttributeNS(null, "ontouchmove",null)
}
var change = {
  37: {
    left: "-=1"
  },

  38: {
    top: "-=1"
  },

  39: {
    left: "+=1"
  },

  40: {
    top: "+=1"
  },
};

var going;

function keyDown(e) {  console.log("down")
  $(document).one("keyup", keyup);
  var animation = change[e.which];
  going = setInterval(keepGoing, 1);

  function keepGoing() {
    $("#mouse").css(animation);
  }

}

function keyup(e) {
  clearInterval(going)
  $(document).one("keydown", keyDown)
}

$( document ).ready(function() {
	$(document).one("keydown", keyDown);
});
</script>
